    - content: >-
        Auxiliary Power Unit for Emergency Power in the Bridge


        WARNING: Consult an engineer for proper handling of electrical wiring. Always wear proper PPE!


        NOTE: The auxiliary substation starts empty, so prepare accordingly.


        Place the HV wire in the orange spot to charge the auxiliary substation.


        Place the MV wire in the yellow spot to connect to the auxiliary APC to the bridge's consoles.
      type: Paper
  - uid: 10867
    components:
    - pos: -42.235825,8.9815645
      parent: 2
      type: Transform
    - stampState: paper_stamp-centcom
      stampedBy:
      - CentCom
      content: >2-
                                                 MEMORANDUM

        FROM: CentCom

        TO: AEGIS STATION COMMAND

        SUBJECT: Auxiliary Command Power


        Hello crew! Your bridge is equipped with an auxiliary substation power source in the nearby maintance area, albeit with a lower capacity. At full capicty, it should last about 2 minutes, specifically, 300kW (measurements excluding the APC battery). This substation should remain disconnected from the main grid to avoid excess power demand and should be connected only to charge the substation. This is to help take some pressure off of the engineering department. Furthermore, the substation only connects to an APC that powers the consoles of the bridge, and not the rest of the command rooms.

        For further instruction and setup, check the auxiliary power room or consult an engineer for more info. Remember to wear proper PPE!
      type: Paper
